import React, { Component } from "react";
import {
  MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBNavbarToggler, MDBCollapse, MDBFormInline,
  MDBDropdown, MDBDropdownToggle, MDBDropdownMenu, MDBDropdownItem
} from "mdbreact";
import { BrowserRouter as Router } from 'react-router-dom';


class Navbar extends Component {
  state = {
    isOpen: false
  };

  toggleCollapse = () => {
    this.setState({ isOpen: !this.state.isOpen });
  }

  componentDidMount() {
    window.addEventListener("scroll", this.handleScroll);
  }

  componentWillUnmount() {
    window.removeEventListener("scroll", this.handleScroll);
  }

  handleScroll = () => {
    if (window.scrollY > 20) {
      document.querySelector(".navbar").className = "navbar   scroll";
    } else {
      document.querySelector(".navbar").className = "navbar";
    }
  };


  componentDidMount() {
    const navbar = document.querySelector('.navbar');
    window.onscroll = () => {
      if (window.scrollY > 200) {
        navbar.classList.add('scrolly',);
      } else {
        navbar.classList.remove('scrolly');
      }
    };
  }


  









  render() {
    return (


      <div className="  header" id="topheader">
        <Router>
          <MDBNavbar className=" navbar scroll fixed-top" dark expand="md">
            <MDBNavbarBrand >
              <div >
                <img src="https://digitaloid.co/wp-content/uploads/elementor/thumbs/cropped-128-by-128-06-05-or2gd3wsgb369julcksmyg09t7ixzrm2zs3otstmxk.png" />
              </div>
            </MDBNavbarBrand>
            <MDBNavbarToggler onClick={this.toggleCollapse} />
            <MDBCollapse id="navbarCollapse3" className="px-4 " isOpen={this.state.isOpen} navbar > 
              <MDBNavbarNav left className="">
                <MDBNavItem active>
                  <MDBNavLink to="" className="nav2 ">Logo</MDBNavLink>
                </MDBNavItem>
                <MDBNavItem className="px-2">
                  <MDBNavLink to="#!">Website</MDBNavLink>
                </MDBNavItem>
                <MDBNavItem>
                  <MDBNavLink to="#!">Animation</MDBNavLink>
                </MDBNavItem>
                <MDBNavItem className="px-2">
                  <MDBDropdown>
                    <MDBDropdownToggle nav caret>
                      <span className="mr-2">Digital Marketing</span>
                    </MDBDropdownToggle>
                    <MDBDropdownMenu>
                      <MDBDropdownItem href="#!">Action</MDBDropdownItem>
                      <MDBDropdownItem href="#!">Another Action</MDBDropdownItem>
                      <MDBDropdownItem href="#!">Something else here</MDBDropdownItem>
                      <MDBDropdownItem href="#!">Something else here</MDBDropdownItem>
                    </MDBDropdownMenu>
                  </MDBDropdown>
                </MDBNavItem>

                <MDBNavItem>
                  <MDBDropdown>
                    <MDBDropdownToggle nav caret>
                      <span className="mr-2">Development</span>
                    </MDBDropdownToggle>
                    <MDBDropdownMenu>
                      <MDBDropdownItem href="#!">Action</MDBDropdownItem>
                      <MDBDropdownItem href="#!">Another Action</MDBDropdownItem>
                      <MDBDropdownItem href="#!">Something else here</MDBDropdownItem>
                      <MDBDropdownItem href="#!">Something else here</MDBDropdownItem>
                    </MDBDropdownMenu>
                  </MDBDropdown>
                </MDBNavItem>

                <MDBNavItem className="px-2">
                  <MDBNavLink to="#!">Combo Packages</MDBNavLink>
                </MDBNavItem>

                <MDBNavItem>
                  <MDBNavLink to="#!">Portfolio</MDBNavLink>
                </MDBNavItem>

                <MDBNavItem className="px-2">
                  <MDBNavLink to="#!">About Us</MDBNavLink>
                </MDBNavItem>

                <MDBNavItem>
                  <MDBNavLink to="#!">Contact Us</MDBNavLink>
                </MDBNavItem>


              </MDBNavbarNav>
              <MDBNavbarNav right>
                <MDBNavItem>
                  <MDBFormInline waves>
                    <div className="md-form my-0">
                      <input className="form-control mr-sm-2" type="text" placeholder="Search" aria-label="Search" />
                    </div>
                  </MDBFormInline>
                </MDBNavItem>
              </MDBNavbarNav>
            </MDBCollapse>
          </MDBNavbar>
        </Router>


        <div className="container right-align">
          <div class="center-div ">
            <h1 class="font-weight-bold text-white">
              Brand Your</h1>
            <h1 class="font-weight-bold text-white">Business With Our</h1>
            <h1 class="font-weight-bold text-white">Affordable And</h1>
            <h1 class="font-weight-bold text-white">Reliable Designs</h1>


            <div class="header-buttons">
              <a href="#"> About Us</a>
              <a href="#"> Contact us</a>
            </div>
          </div>

          <div className=" center-div2 align-right">
            <img src="https://digitaloid.co/wp-content/uploads/2020/06/header-01-01.png" width="522px" height="436px" className="img-fluid img-responsive " />
          </div>
        </div>



      </div>


    );
  }
}

export default Navbar;
